Custom content type with explicit MIME type

Example:
  Request { body :: CustomContentType "application/vnd.api+json" User }

Type-safe handler tied to a route's computed types.

Usage:
  myHandler :: Handler (id :: Int) (limit :: Maybe Int) (authorization :: BearerToken) User
    (ok :: ResponseData () (Array Post), notFound :: ResponseData () ErrorMessage)
  myHandler { path, query, headers, body } = do
    -- path :: { id :: Int }
    -- query :: { limit :: Maybe Int }
    -- headers :: { authorization :: BearerToken }
    -- body :: User
    pure $ respondNoHeaders (Proxy :: _ "ok") []

Collect OpenAPI operations from a type-level structure of routes.
Use a Record to combine multiple named routes:
  CollectOperations { getUser :: RouteA, createUser :: RouteB }

